import React, { Component } from 'react'

export default class Card extends Component {
    render() {
        return (
            <div className='col-3 Card'>
                <div className="card">
                    <img src="https://media.gq-magazin.de/photos/64119db6f0519357107d1819/1:1/w_1687,h_1687,c_limit/Porsche%20Cayenne%20SUV%20GT.jpeg" className="card-img-top" alt="..." />
                    <div className="card-body">
                        <p className="card-text">Tận hưởng những khoảnh khắc đáng nhớ với Porsche.</p>
                        <h5 className="card-title">Porsche 911</h5>
                        <a href="#" className="btn btn-primary">Xem chi tiết</a>
                    </div>
                </div>

            </div>
        )
    }
}
